import React, { Component } from 'react'
import { Link } from "react-router-dom"
import "../config/fire"
import * as firebase from "firebase"

export default class Student extends Component {
    constructor(props) {
        super(props)

        this.state = {
            username: "",
            password: ""
        };
    };



    handlesubmit = (e) => {
        e.preventDefault()
        firebase.database()
            .ref("students")
            .push({
                username: this.state.username,
                password: this.state.password
            })
    }


    render() {
        return (

            <div>
                <div className="signup">

                    <form onSubmit={this.handlesubmit}>
                        <input type="text" name="username" placeholder="first name" required onChange={e => this.setState({ username: e.target.value })} />
                        <input type="text" name="username" placeholder="last name" required onChange={e => this.setState({ username: e.target.value })} /><br />
                        <input type="text" name="username" placeholder="email" required onChange={e => this.setState({ username: e.target.value })} /><br />

                        <input type="password" name="password" placeholder="Password" onChange={e => this.setState({ password: e.target.value })} /><br />

                        <input type="submit" value="Login"></input>
                    </form>

                </div>

                <div className="cmd">

                    <label><h2>Student login</h2></label>
                    <form onSubmit={this.handlesubmit}>
                        <input type="text" name="username" placeholder="Username" required onChange={e => this.setState({ username: e.target.value })} /><br />

                        <input type="password" name="password" placeholder="Password" onChange={e => this.setState({ password: e.target.value })} /><br />

                        <input type="submit" value="Login"></input>
                    </form>

                </div>

                {/*just for testing  */}
                <div>
                    <Link to="/student/studentprofile" className="sbtn">
                        <button className="sbtn">student profile</button>
                    </Link>
                </div>

            </div>

        )
    }
}
